import React, { useState, useEffect } from "react";

/* import Create from "./test";
 */ const App = () => {
  const [movie, setMovie] = useState([]);
  const api =
    "https://api.themoviedb.org/3/search/movie?api_key=fac34116c639f3e75cd5205251be421c&query=search";

  useEffect(() => {
    fetch(api)
      .then((res) => res.json())
      .then((res) => setMovie(res.results));
  }, []);

  return <div>{console.log(movie)}</div>;
};

export default App;
